import React from 'react';
import notes from "./notes.js";

const note = (props) => {
    return (<div className="note">
        <h1>{props.title}</h1>
        <p>{props.content}</p>
    </div>);
}

const Note = () => {
    return(
        notes.map(note)
    );
}

export default Note;
